import {
  Box,
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  Image,
} from '@chakra-ui/react';

const Dashboard = () => {
  return (
    <Box
      bgColor="blue.50"
      w="100%"
      display="flex"
      h="auto"
      padding="32px"
    ></Box>
  );
};

export default Dashboard;
